'''
    英国经纬度范围：经度：-7~2； 纬度：50~58
'''
def WordApperGeo(word):
    geo_x = []
    geo_y = []
    for value in data.values():
        if word in value['words']:
            geo_x.append(value['coordinates']['coordinates'][0])
            geo_y.append(value['coordinates']['coordinates'][1])
    return geo_x, geo_y

def Plot(wordHign, wordMid1, wordMid2, wordLow):
    plt.figure()
    plt.subplot(2, 2, 1)
    plt.axis([-7, 2, 50, 58])  # 设置坐标轴范围
    geo_x, geo_y = WordApperGeo(wordHign)
    plt.scatter(geo_x, geo_y, c='r', marker='o')
    plt.title(wordHign + "'s CSR index: " + str(dict[wordHign]))
    # plt.xlabel("longitude")
    plt.ylabel("latitude")
    plt.subplot(2, 2, 3)
    plt.axis([-7, 2, 50, 58])  # 设置坐标轴范围
    geo_x, geo_y = WordApperGeo(wordMid1)
    plt.scatter(geo_x, geo_y, c='r', marker='o')
    plt.title(wordMid1 + "'s CSR index: " + str(dict[wordMid1]))
    plt.xlabel("longitude")
    plt.ylabel("latitude")
    plt.subplot(2, 2, 2)
    plt.axis([-7, 2, 50, 58])  # 设置坐标轴范围
    geo_x, geo_y = WordApperGeo(wordMid2)
    plt.scatter(geo_x, geo_y, c='r', marker='o')
    plt.title(wordMid2 + "'s CSR index: " + str(dict[wordMid2]))
    # plt.xlabel("longitude")
